import axios from "axios";
import React, {useState,useEffect} from "react";


const Report=()=>{
    const [report,setReport]=useState([]);

    useEffect(()=>{
        const Res=async()=>{
            const {data}=await axios.get("http://127.0.0.1:8000/api/report/")
            console.log(data);
            setReport(data);
        }
        Res();
    },[])
    console.log(report)
    return (
        <div>bvbnv</div>
    )
}
export default Report;
